import React from 'react';
import {useState} from 'react';
import { useDispatch } from 'react-redux';
import {getNameExpedientes} from '../../actions';

export default function SearchBarExp(){
     // aca usamos Hook
    const dispatch = useDispatch()
    const [numexpediente, setNumexpediente] = useState("");
    // const [adrema,setAdrema] = useState("");

    function handInputChange(p){
        p.preventDefault()
        setNumexpediente(p.target.value)        
    }
    // function handInputChangeAdrema(p){
    //     p.preventDefault()
    //     setAdrema(p.target.value)
    // }
    function handleSubmit(p){
        p.preventDefault()
        dispatch(getNameExpedientes(numexpediente))
    }
    // function handleSubmitAdrema(p){
    //     p.preventDefault()
    //     dispatch(getNameExpedientes(adrema))
    // }
    return (
        <div>
            {/* //cuando apreto enter el form hace en submit */}
            <form onSubmit={(p)=> handleSubmit(p)}> 
                <input
                type = 'text'
                placeholder = "Expediente..."
                onChange={(p) => handInputChange(p)}                
            />            
                <button type='submit'>Buscar</button>
            </form>
            {/* <br/>
            <form onSubmit={(p)=> handleSubmitAdrema(p)}> 
                <input
                type = 'text'
                placeholder = "Adrema..."
                onChange={(p) => handInputChangeAdrema(p)}                
            />
                <button type='submit'>Buscar</button>
            </form> */}
        </div>
    )
}
